    password: "",
  });

  useEffect(() => {
    //axiosWithAuth().post("/api/login")
  });

  return (
    <>
      <h1>Login</h1>
      <form>
        Username: <input type="text" name="username" />
        Password: <input type="text" name="password" />
        <br />
        <button>Login</button>
      </form>
    </>
  );
};

